import React,{useEffect, useState} from 'react';
import groupBy from 'lodash.groupby';
import sortBy from 'lodash.sortby';
import {requestToAPI} from './containers/API';
import './App.css';

function App() {

  const [result,setResult] = useState([]);

  useEffect(()=>{
    requestToAPI().then((result)=>{
      setResult(result.items);
      console.log(result.items[0]);
    })
  },[]);

  const buildingZones = groupBy(result, 'buildingzone');
  console.log("Hola:",buildingZones);

  return (
    <div className="App">
      {Object.keys(buildingZones).map((buildings,index)=>{
        return <div key={index}>{buildingZones.buildingname}</div>
      })}
    </div>
  );
}

export default App;
